import React from 'react'
import UserStore from './stores/UserStore'
import './App.css'

export default class App extends React.Component {
    render() {
        const styles = {
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            flexDirection: 'Column'
        }

        const btnStyles = {
            borderRadius: "15px",
            backgroundColor: "#ff304f",
            color: "#fff",
            padding: "10px 20px",
            cursor: "pointer"
        }

        return (
            <div  style={styles}>
                <div>Welcome {UserStore.username} {'  '}</div>
                <button style={btnStyles} onClick={this.props.handleLogout}>Logout Button</button>
            </div>
        )
    }
}
